import React, { Component } from 'react';

import vid1 from '../video/vid1.mp4'
import vid2 from '../video/vid2.mp4'
import vid3 from '../video/vid3.mp4'
import vid4 from '../video/vid4.mp4'
import vid5 from '../video/vid5.mp4'
import vid6 from '../video/vid6.mp4'


export class Videos extends Component{
  render(){

    return (
    	<div className="vid">
    		<video src={vid1} width="600" height="300" controls="controls"  />
			<video src={vid2} width="600" height="300" controls="controls"  />
			<video src={vid3} width="600" height="300" controls="controls"  />
			<video src={vid4} width="600" height="300" controls="controls"  />
			<video src={vid5} width="600" height="300" controls="controls"  />
			<video src={vid6} width="600" height="300" controls="controls"  />
    	</div>
    	);


  }

}


export default Videos;
